// create the benchmark and execute it. 
private Benchmark execBenchmark(String[] algLines) throws Exception {
  String algText = algLinesToText(algLines);
  logTstLogic(algText);
  Benchmark benchmark = new Benchmark(new StringReader(algText));
  benchmark.execute();
  return benchmark;
}

